import gmpy2
import libnum
import uuid

flag = "flag{" + str(uuid.uuid4()) + "}"
print(flag)
m = libnum.s2n(flag)

p = libnum.generate_prime(512)
q = libnum.generate_prime(512)
e = 65537
n = p * q

h = 20233202
hc = pow(h + p * 2023, e, n)

c = pow(m, e, n)
print("hc=", hc)
print("n=", n)
print("c=", c)

